import{_ as t}from"./_plugin-vue_export-helper.cdc0426e.js";import{o as a,c as e,e as n}from"./app.98581f3b.js";const s={},l=n(`<h2 id="对象" tabindex="-1"><a class="header-anchor" href="#对象" aria-hidden="true">#</a> 对象</h2><p>基本数据类型都是单一的值，值和值之间没有任何联系，构不成整体。</p><p>对象是一种复合的数据类型，在对象中可以保存多个不同数据类型的属性。</p><h3 id="内建对象" tabindex="-1"><a class="header-anchor" href="#内建对象" aria-hidden="true">#</a> 内建对象</h3><p>由 ES 标准中定义的对象，在任何的 ES 的实现中都可以使用。</p><p>Math String Number Boolean</p><p>平时使用的强制类型转换实际上调用的就是 String、Number 这些内建对象的方法</p><h3 id="宿主对象" tabindex="-1"><a class="header-anchor" href="#宿主对象" aria-hidden="true">#</a> 宿主对象</h3><p>JS 运行环境提供的对象，主要指浏览器提供的对象：<strong>BOM</strong>、<strong>DOM</strong>。</p><h3 id="自定义对象" tabindex="-1"><a class="header-anchor" href="#自定义对象" aria-hidden="true">#</a> 自定义对象</h3><p>自行创建对象，使用构造函数。new Object()</p><ul><li><p>常规语法：对象.属性名</p></li><li><p>属性名：不强制要求遵守标识符命名规范。</p></li><li><p>写法：</p></li></ul><div class="language-javascript line-numbers-mode" data-ext="js"><pre class="language-javascript"><code>obj<span class="token punctuation">.</span>name<span class="token operator">=</span><span class="token string">&quot;***&quot;</span>

obj<span class="token punctuation">[</span><span class="token string">&quot;name&quot;</span><span class="token punctuation">]</span><span class="token operator">=</span><span class="token string">&quot;***&quot;</span>

obj<span class="token operator">=</span><span class="token punctuation">{</span><span class="token literal-property property">name</span><span class="token operator">:</span><span class="token string">&quot;***&quot;</span><span class="token punctuation">,</span>

​		gender<span class="token operator">:</span><span class="token string">&quot;***&quot;</span><span class="token punctuation">,</span>

​		age<span class="token operator">:</span><span class="token operator">**</span><span class="token operator">*</span>&quot;

<span class="token punctuation">}</span><span class="token punctuation">;</span>
</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div></div></div><ol><li><p>对象字面值的属性名可以加引号也可以不加，建议不加。</p></li><li><p>如果要使用一些特殊的名字，则必须加引号。</p></li><li><p>属性名和属性值是一组一组的键值对结构。</p></li><li><p>键值之间使用 : 连接，多个键值对之间使用 , 隔开</p></li><li><p>如果一个属性之后没有其他的属性，就不要写 ,</p></li></ol><h2 id="函数" tabindex="-1"><a class="header-anchor" href="#函数" aria-hidden="true">#</a> 函数</h2><p>函数也是一个对象，函数可以封装一些功能（代码），在需要时可以执行这些功能。</p><h3 id="语法" tabindex="-1"><a class="header-anchor" href="#语法" aria-hidden="true">#</a> 语法</h3><p>var fun = new Function();</p><p>实际开发中很少使用构造函数来创建函数对象。更多使用函数声明创建。</p><p>function 函数名([形参 1, 形参 2, ……]) {</p><p>​ 语句……</p><p>}</p><h3 id="参数" tabindex="-1"><a class="header-anchor" href="#参数" aria-hidden="true">#</a> 参数</h3><p>1.调用函数时解析器不会检查实参类型，所以要注意是否有可能接收到非法参数。</p><p>2.同时解析器也不会检查实参的数量。多余的实参不会被赋值。</p><p>3.如果实参的数量少于形参的数量，则没有对应实参的形参将是 undefined。</p><p>4.实参可以是任意数据类型，可以是对象，也可以是函数。</p><p><strong>注意：</strong></p><ul><li><p>fun()：是调用函数的意思，相当于使用函数返回值</p></li><li><p>fun：是函数对象，相当于直接使用函数对象</p></li></ul><h3 id="返回值" tabindex="-1"><a class="header-anchor" href="#返回值" aria-hidden="true">#</a> 返回值</h3><p>1.返回值可以是任意数据类型，可以是对象也可以是函数。</p><p>2.返回值 return 如果不跟任何值则返回 <strong>undefined</strong>，不写 return 也返回 <strong>undefined</strong>。</p><h3 id="iife-立即执行函数" tabindex="-1"><a class="header-anchor" href="#iife-立即执行函数" aria-hidden="true">#</a> IIFE 立即执行函数</h3><p>语法：(function() { * * * * * *})();</p><p>函数定义完，立即被调用，这种函数叫做立即执行函数。往往只会执行一次。</p><h3 id="方法" tabindex="-1"><a class="header-anchor" href="#方法" aria-hidden="true">#</a> 方法</h3><p>函数可以成为对象的属性，如果一个函数作为一个对象的属性保存，那么称这个函数是这个对象的方法。</p><div class="language-javascript line-numbers-mode" data-ext="js"><pre class="language-javascript"><code><span class="token keyword">var</span> obj <span class="token operator">=</span> <span class="token punctuation">{</span>
  <span class="token function-variable function">test</span><span class="token operator">:</span> <span class="token keyword">function</span> <span class="token punctuation">(</span><span class="token punctuation">)</span> <span class="token punctuation">{</span>
    console<span class="token punctuation">.</span><span class="token function">log</span><span class="token punctuation">(</span><span class="token string">&quot;hello&quot;</span><span class="token punctuation">)</span><span class="token punctuation">;</span>
  <span class="token punctuation">}</span><span class="token punctuation">,</span>
<span class="token punctuation">}</span><span class="token punctuation">;</span>
<span class="token comment">// &quot;hello&quot;</span>
obj<span class="token punctuation">.</span><span class="token function">test</span><span class="token punctuation">(</span><span class="token punctuation">)</span><span class="token punctuation">;</span>
</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div></div></div><h2 id="作用域" tabindex="-1"><a class="header-anchor" href="#作用域" aria-hidden="true">#</a> 作用域</h2><p>作用域指一个变量的作用范围</p><h3 id="全局作用域" tabindex="-1"><a class="header-anchor" href="#全局作用域" aria-hidden="true">#</a> 全局作用域</h3><ol><li><p>全局作用域指直接编写在 script 标签中的 js 代码。</p></li><li><p>全局作用域在页面打开时创建，在页面关闭时销毁。</p></li><li><p>在全局作用域中有一个全局对象 window，它代表的是一个浏览器窗口，由浏览器创建，可直接使用。</p></li><li><p>全局作用域中创建的变量都会作为 window 对象属性保存，创建的函数作为 window 对象方法保存。</p></li><li><p>变量声明提前，使用 var 关键字声明的变量，会在所有代码执行之前被声明（但是不赋值）。但是如果声明变量时不使用 var 关键字，则变量不会被声明提前。</p></li><li><p>函数声明提前，使用函数声明形式创建的函数 function 函数 K{}，它会在所有代码执行之前声明。但是使用函数表达式 var fun = function(){}创建的函数，能提前声明对象，但不会被赋值。</p></li><li><p>全局作用域中的变量都是全局变量，在页面的任意部分都可以访问得到。</p></li></ol><div class="language-javascript line-numbers-mode" data-ext="js"><pre class="language-javascript"><code><span class="token comment">// undefined，不会报错</span>
console<span class="token punctuation">.</span><span class="token function">log</span><span class="token punctuation">(</span>carName<span class="token punctuation">)</span><span class="token punctuation">;</span>
<span class="token keyword">var</span> carName <span class="token operator">=</span> <span class="token string">&quot; Volvo&quot;</span><span class="token punctuation">;</span>

<span class="token comment">// 此处可调用 carName 变量</span>
<span class="token keyword">function</span> <span class="token function">myFunction</span><span class="token punctuation">(</span><span class="token punctuation">)</span> <span class="token punctuation">{</span>
  <span class="token comment">// 函数内可调用 carName 变量</span>
<span class="token punctuation">}</span>
</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div></div></div><h3 id="函数作用域" tabindex="-1"><a class="header-anchor" href="#函数作用域" aria-hidden="true">#</a> 函数作用域</h3><ol><li><p>调用函数时创建函数作用域，函数执行完毕以后，函数作用域销毁。</p></li><li><p>每调用一次函数就会创建一个新的函数作用域，他们之间相互独立。</p></li><li><p>函数作用域中可以访问到全局作用域变量，在全局作用域中无法访问到函数作用域的变量。</p></li><li><p>函数作用域中操作变量时，会先在自身作用域中寻找，如果有就直接使用，没有则向上一级作用域寻找直到向全局作用域寻找。如果全局作用域仍未找到，则报错 ReferenceError。</p></li><li><p>在函数中要访问全局变量可以使用 window 对象。</p></li><li><p>在函数作用域也有提前声明特性，使用 var 关键字声明变量，会在函数中所有代码执行前提前声明。函数声明同理。</p></li><li><p>如果变量在函数内没有声明（没有使用 var 关键字），该变量为全局变量。</p></li><li><p>定义形参就相当于在函数作用域中声明了变量</p></li></ol><p>以下实例中 carName 在函数内，但是为全局变量。</p><div class="language-javascript line-numbers-mode" data-ext="js"><pre class="language-javascript"><code><span class="token comment">// 此处可调用 carName 变量</span>

<span class="token keyword">function</span> <span class="token function">myFunction</span><span class="token punctuation">(</span><span class="token punctuation">)</span> <span class="token punctuation">{</span>
  carName <span class="token operator">=</span> <span class="token string">&quot;Volvo&quot;</span><span class="token punctuation">;</span>
  <span class="token comment">// 此处可调用 carName 变量</span>
<span class="token punctuation">}</span>
</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div></div></div><h2 id="数组-array" tabindex="-1"><a class="header-anchor" href="#数组-array" aria-hidden="true">#</a> 数组 Array</h2><p>数组是一个对象，使用数字作为索引操作元素，不同于普通对象使用字符串作为属性名操作。</p><h3 id="常见特性" tabindex="-1"><a class="header-anchor" href="#常见特性" aria-hidden="true">#</a> 常见特性</h3><ul><li><p>如果读取不存在的索引，不会报错而是返回 undefined。</p></li><li><p>对非连续数组，length 获取数组最大索引+1 长度。（尽量不要创建非连续数组）</p></li><li><p>修改的 length 大于原长度，多余部分会空出来。</p></li><li><p>给数组最后一个元素后面添加元素：arr[length] = xxx;</p></li></ul><h3 id="字面量" tabindex="-1"><a class="header-anchor" href="#字面量" aria-hidden="true">#</a> 字面量</h3><p>数组中的元素可以是任意数据类型</p><p>var arr = [];</p><p>var arr2 = new Array( );</p><p>小区别：</p><p>arr = [10] 创建一个单元素 10 的数组</p><p>arr = new Array(10) 创建一个长度为 10 的数组</p><h3 id="常用数组方法" tabindex="-1"><a class="header-anchor" href="#常用数组方法" aria-hidden="true">#</a> 常用数组方法</h3><h4 id="_1-push" tabindex="-1"><a class="header-anchor" href="#_1-push" aria-hidden="true">#</a> 1. push</h4><p>该方法可以向数组的末尾添加一个或多个元素，并返回数组的新长度</p><p>可以将要添加的元素作为方法的参数传递，这些元素会自动添加到数组末尾</p><p>该方法会将数组新的长度作为返回值返回</p><h4 id="_2-pop" tabindex="-1"><a class="header-anchor" href="#_2-pop" aria-hidden="true">#</a> 2. pop</h4><p>该方法可以删除数组的最后一个元素，并将被删除的元素作为返回值返回</p><h4 id="_3-unshift" tabindex="-1"><a class="header-anchor" href="#_3-unshift" aria-hidden="true">#</a> 3. unshift</h4><p>向数组开头添加一个或多个元素，并返回新的数组长度</p><p>向前边插入元素以后，其他的元素索引会依次调整</p><h4 id="_4-shift" tabindex="-1"><a class="header-anchor" href="#_4-shift" aria-hidden="true">#</a> 4. shift</h4><p>可以删除数组的第一个元素，并将被删除的元素作为返回值返回</p><h4 id="_5-slice" tabindex="-1"><a class="header-anchor" href="#_5-slice" aria-hidden="true">#</a> 5. slice</h4><p>可以用来从数组提取指定元素</p><p>该方法不会改变元素数组，而是将截取到的元素封装到一个新数组中返回</p><p>参数：</p><p>1.截取开始的位置索引，包含开始索引</p><p>2.截取结束的位置索引，不包含结束索引</p><ul><li><p>第二个参数可以省略不写，此时会截取从开始索引往后的所有元素</p></li><li><p>索引可以传递一个负值，如果传递一个负值，则从后往前计算</p></li></ul><h4 id="_6-splice" tabindex="-1"><a class="header-anchor" href="#_6-splice" aria-hidden="true">#</a> 6. splice</h4><p>可以用于删除数组中的指定元素</p><p>使用 splice() 会影响到原数组，会将指定元素从原数组中删除，并将被删除的元素作为返回值数组返回</p><p>参数：</p><ol><li><p>表示开始位置的索引</p></li><li><p>表示删除的数量</p></li><li><p>第三个及以后可以传递一些新的元素，这些元素将会自动插入到开始位置索引前</p></li></ol><h4 id="_7-concat" tabindex="-1"><a class="header-anchor" href="#_7-concat" aria-hidden="true">#</a> 7. concat</h4><p>可以连接两个或多个数组，并将新的数组返回</p><p>该方法不会对原数组产生影响</p><h4 id="_8-join" tabindex="-1"><a class="header-anchor" href="#_8-join" aria-hidden="true">#</a> 8. join</h4><p>该方法可以将数组转换为一个字符串</p><p>该方法不会对原数组产生升影响，而是将转换后的字符串作为结果返回</p><p>在 join()中可以指定一个字符串作为参数，这个字符串将会成为数组中元素的连接符。如果不指定连接符，则默认使用 , 作为连接符。</p><h4 id="_9-reverse" tabindex="-1"><a class="header-anchor" href="#_9-reverse" aria-hidden="true">#</a> 9. reverse</h4><p>该方法用来反转数组（前边的去后边，后边的去前边）</p><p>该方法会直接修改原数组</p><h4 id="_10-sort" tabindex="-1"><a class="header-anchor" href="#_10-sort" aria-hidden="true">#</a> 10. sort</h4><p>可以用来对数组中的元素进行排序</p><p>也会影响原数组，默认会按照 Unicode 编码进行排序</p><ul><li><p>即时对于纯数字的数组，使用 sort() 排序时，也会按照 Unicode 编码来排序，所以对数字进行默认排序时，可能会得到错误结果。</p></li><li><p>我们可以在 sort()添加一个回调函数，来指定排序规则</p></li></ul><p>回调函数中需要定义两个形参，浏览器将会分别使用数组中的元素作为实参自动调用回调函数，使用哪个元素调用不确定，但肯定的是数组中 a 一定在 b 前面</p><ul><li>浏览器会根据回调函数的返回值来决定元素的顺序：</li></ul><ol><li><p>如果返回一个大于 0 的值，则元素会交换位置</p></li><li><p>如果返回一个小于 0 的值，则元素位置不变</p></li><li><p>如果返回一个 0，则认为两个元素相等，也不交换位置</p></li></ol><h4 id="_11-indexof" tabindex="-1"><a class="header-anchor" href="#_11-indexof" aria-hidden="true">#</a> 11. indexOf</h4><p>检索一个数组是否含有指定元素。</p><p>如果数组中含有该元素，则返回其第一次出现的数组元素索引。如果没有返回-1。</p><p>可以指定第二个参数，指定开始查找的位置。</p><h4 id="_12-lastindexof" tabindex="-1"><a class="header-anchor" href="#_12-lastindexof" aria-hidden="true">#</a> 12. lastIndexOf</h4><p>可返回一个指定的字符串值最后出现的位置，如果指定第二个参数 start，则在一个字符串中的指定位置从后向前搜索</p><p>注意： 该方法将从后向前检索字符串，但返回是从起始位置 (0) 开始计算子字符串最后出现的位置。 看它是否含有字符串。</p><p>开始检索的位置在字符串的 start 处或字符串的结尾（没有指定 start 时）。</p><p>如果没有找到匹配字符串则返回 -1 。</p><h2 id="日期-date" tabindex="-1"><a class="header-anchor" href="#日期-date" aria-hidden="true">#</a> 日期 Date</h2><p>在 JS 中使用 Date 对象表示一个时间</p><p>如果直接使用构造函数创建 Date 对象，会封装为当前代码执行时间。</p><p>日期格式 new Date(&quot;01/01/2021 00:00:00&quot;); （括号内参数仅为 1 个，表示为毫秒）</p><table><thead><tr><th style="text-align:left;">方法</th><th style="text-align:left;">描述</th></tr></thead><tbody><tr><td style="text-align:left;">getDate()</td><td style="text-align:left;">从 Date 对象返回一个月中的某一天(1~31)</td></tr><tr><td style="text-align:left;">getDay()</td><td style="text-align:left;">从 Date 对象返回一周中的某一天(0~6)</td></tr><tr><td style="text-align:left;">getMonth()</td><td style="text-align:left;">从 Date 对象返回月份(0~1)</td></tr><tr><td style="text-align:left;">getFullYear()</td><td style="text-align:left;">从 Date 对象以四位数字返回年份</td></tr><tr><td style="text-align:left;">getYear()</td><td style="text-align:left;">请使用 getFullYear()方法代替</td></tr><tr><td style="text-align:left;">getHours()</td><td style="text-align:left;">返回 Date 对象的小时(0~23)</td></tr><tr><td style="text-align:left;">getMinutes()</td><td style="text-align:left;">返回 Date 对象的分钟(0~59)</td></tr><tr><td style="text-align:left;">getSeconds()</td><td style="text-align:left;">返回 Date 对象的秒数(0~59)</td></tr><tr><td style="text-align:left;">getMilliseconds()</td><td style="text-align:left;">返回 Date 对象的毫秒(0~999)</td></tr><tr><td style="text-align:left;">getTime()</td><td style="text-align:left;">返回 1970 年 1 月 1 日至今的毫秒数</td></tr><tr><td style="text-align:left;">Date.now()</td><td style="text-align:left;">立即获取当前日期相对 1970 年 1 月 1 日的毫秒数时间戳</td></tr></tbody></table><h2 id="数学-math" tabindex="-1"><a class="header-anchor" href="#数学-math" aria-hidden="true">#</a> 数学 Math</h2><p>Math 不是构造函数，属于一个工具类不用创建对象，封装了数学运算相关属性和方法。</p><h3 id="对象属性" tabindex="-1"><a class="header-anchor" href="#对象属性" aria-hidden="true">#</a> 对象属性</h3><table><thead><tr><th style="text-align:left;">值</th><th style="text-align:left;">描述</th></tr></thead><tbody><tr><td style="text-align:left;">E</td><td style="text-align:left;">返回算术常量 e，即自然对数的底数(约等于 2.718)</td></tr><tr><td style="text-align:left;">LN2</td><td style="text-align:left;">返回 2 的自然对数(约等于 0.693)</td></tr><tr><td style="text-align:left;">LN10</td><td style="text-align:left;">返回 10 的自然对数(约等于 2.302)</td></tr><tr><td style="text-align:left;">LOG2E</td><td style="text-align:left;">返回以 2 为底的 e 的对数(约等于 1.414)</td></tr><tr><td style="text-align:left;">LOG10E</td><td style="text-align:left;">返回以 10 为底的 e 的对数(约等于 0.434)</td></tr><tr><td style="text-align:left;">PI</td><td style="text-align:left;">返回圆周率(约等于 3.14159)</td></tr><tr><td style="text-align:left;">SQRT1_2</td><td style="text-align:left;">返回 2 的平方根的倒数(约等于 0.707)</td></tr><tr><td style="text-align:left;">SQRT2</td><td style="text-align:left;">返回 2 的平方根(约等于 1.414)</td></tr></tbody></table><h3 id="对象方法" tabindex="-1"><a class="header-anchor" href="#对象方法" aria-hidden="true">#</a> 对象方法</h3><table><thead><tr><th style="text-align:left;">方法</th><th style="text-align:left;">描述</th></tr></thead><tbody><tr><td style="text-align:left;">abs(x)</td><td style="text-align:left;">返回数的绝对值</td></tr><tr><td style="text-align:left;">acos(x)</td><td style="text-align:left;">返回数的反余弦值</td></tr><tr><td style="text-align:left;">asin(x)</td><td style="text-align:left;">返回数的反正弦值</td></tr><tr><td style="text-align:left;">atan(x)</td><td style="text-align:left;">以介于 -PI/2 与 PI/2 弧度之间的数值来返回 x 的反正切值</td></tr><tr><td style="text-align:left;">atan2(y,x)</td><td style="text-align:left;">返回从 x 轴到点(x,y)的角度（介于 -PI/2 与 PI/2 弧度之间）</td></tr><tr><td style="text-align:left;">ceil(x)</td><td style="text-align:left;">对数进行上舍入（进一法）</td></tr><tr><td style="text-align:left;">cos(x)</td><td style="text-align:left;">返回数的余弦值</td></tr><tr><td style="text-align:left;">exp(x)</td><td style="text-align:left;">返回 e 的指数</td></tr><tr><td style="text-align:left;">floor(x)</td><td style="text-align:left;">对数进行下舍入（取余法）</td></tr><tr><td style="text-align:left;">log(x)</td><td style="text-align:left;">返回数的自然对数(底为 e)</td></tr><tr><td style="text-align:left;">max(x,y)</td><td style="text-align:left;">返回 x 和 y 中的最大值</td></tr><tr><td style="text-align:left;">min(x,y)</td><td style="text-align:left;">返回 x 和 y 中的最小值</td></tr><tr><td style="text-align:left;">pow(x,y)</td><td style="text-align:left;">返回 x 的 y 次幂</td></tr><tr><td style="text-align:left;">random()</td><td style="text-align:left;">返回 0~1 之间的随机数</td></tr><tr><td style="text-align:left;">round(x)</td><td style="text-align:left;">把数四舍五入为最接近的整数</td></tr><tr><td style="text-align:left;">sin(x)</td><td style="text-align:left;">返回数的正弦</td></tr><tr><td style="text-align:left;">sqrt(x)</td><td style="text-align:left;">返回数的平方根</td></tr><tr><td style="text-align:left;">tan(x)</td><td style="text-align:left;">返回角的正切</td></tr><tr><td style="text-align:left;">toSource(x)</td><td style="text-align:left;">返回该对象的源代码</td></tr><tr><td style="text-align:left;">valueOf()</td><td style="text-align:left;">返回 Math 对象的原始值</td></tr></tbody></table><p>生成 x~y 之间的随机数公式：</p><p><code>Math.round(Math.random() * (y-x) + x)</code></p><h2 id="包装类" tabindex="-1"><a class="header-anchor" href="#包装类" aria-hidden="true">#</a> 包装类</h2><p>js 的包装类指 String() Number() Boolean()</p><p>注意：实际应用中基本不会使用基本数据类型对象，因为使用时会带来不可预期的结果。</p><p>包装类的实际应用：对基本数据类型的值去调用属性和方法时，浏览器临时使用包装类将其转换为对象，再调用属性和方法，调用完毕后转为基本数据类型。</p><h2 id="字符串-string" tabindex="-1"><a class="header-anchor" href="#字符串-string" aria-hidden="true">#</a> 字符串 String</h2><p>之所以把字符串放到对象章节，是因为字符串底层也是以字符数组的形式保存的。字符串很多方法与数组方法有异曲同工之处。</p><h3 id="字符串获取" tabindex="-1"><a class="header-anchor" href="#字符串获取" aria-hidden="true">#</a> 字符串获取</h3><p>1.charAt()</p><p>返回字符串中指定位置的字符，根据索引获取指定字符。</p><p>2.charCodeAt()</p><p>获取指定位置字符的字符编码（Unicode编码）。</p><p>3.String.formCharCode()</p><p>根据字符编码去获取字符。</p><h3 id="字符串拼接" tabindex="-1"><a class="header-anchor" href="#字符串拼接" aria-hidden="true">#</a> 字符串拼接</h3>`,135),i=[l];function d(r,p){return a(),e("div",null,i)}const h=t(s,[["render",d],["__file","Object对象.html.vue"]]);export{h as default};
